import React from 'react';

import './App.css';
import {Botton,Form , FormGroup,Input,Label, Button} from 'reactstrap';
import {FacebookLoginButton} from 'react-social-login-buttons';

function App() {
  return (
    <Form className="App">
      <h1>
         <span className="font-weight-bold">myForm</span>
      </h1>
      <h2 className="text-center">Welcome</h2>
      <FormGroup>
       <Label>Name</Label>
       <Input type="text" placeholder="Name"></Input>
      </FormGroup>
      <FormGroup>
       <Label>Branch</Label>
       <Input type="text" placeholder="Branch"></Input>
      </FormGroup>
      <FormGroup>
       <Label>Email</Label>
       <Input type="email" placeholder="Email"></Input>
      </FormGroup>

      <Button className="btn-lg btn-dark btn-block" onClick="addToLocaStorage()">Submit</Button>
    </Form>
  );
}
function addToLocaStorage(){
const inputs=document.querySelectorAll('input');
const name=inputs[0].value;
const branch=inputs[1].value;
const email=inputs[2].value;
localStorage.setItem(name,branch,email);
window.location.reload();

}

export default App;
